                                    Prof. Funminiyi Abiodun Raheem Adeleke, also known as F.A.R Adeleke, attended Obafemi Awolowo University Ile Ife, where he bagged his LL.B Hons degree in law. He had his LLM (Masters of Law at the University of Lagos Akoka. He was called to t");
            WriteLiteral(@"he bar and started his professional/academic career by joining the Department of Public Law, Lagos State University, in 1999. He combined academic with legal practice in Lagos, thereby contributing to the legal profession's development in his own right.
                                    He travelled to South Africa, where he studied for his doctoral law degree and returned to Nigeria with an LLD (Doctor of Laws) degree from the Nelson Mandela School of Law, University of Fort hare, East London, South Africa.
                                </p>
                                <p>
                                    In his doctoral degree, he was engaged as a Tutor in some law courses that he taught along with some lecturers in the Nelson Mandela School of Law, South Africa. Prof Adeleke returned to Lagos State University, where he rose through the ranks till, he became a Professor in 2015.
                                    At Lagos State University, Prof Adeleke has taught many law courses, both comp");
            WriteLiteral(@"ulsory and optional ones. These courses include Constitutional law, International Human Rights Law, Criminal Law, Administrative Law, Islamic Family Law, and Law of Evidence. He has undertaken these courses both at the undergraduate and postgraduate levels. He is especially skilled in taking specialised law courses like Ports Policy.
                                    He has held many administrative positions at various times within the university. Specifically, he was the Co-coordinator of the Diploma in Law programme between 2002 and 2004.  He was also a Co-coordinator of the LL.B Evening Law programme between 2005 and 2007. He was made the Programme Officer and Co-coordinator for LLM General, Masters in Maritime Law and PGD Maritime Law, all in Lagos State University between 2011 and 2014. He also served as a member of several Faculty and University Committees.
                                </p>
                                <p>
                                    He was nominated and served as on");
            WriteLiteral(@"e of the Academic Staff Union representatives in the University Senate for 2013 and 2014. He became the Managing Editor of the LASU LAW Journal 2012 – 2016. He was a Head of the Department of Public Law, Public and Private Law and Editor in Chief of Lasu Law Journal. He was elected as Dean of the Faculty of Law, Lagos State University Ojo, on February 1st, 2017. He served as a member of the Governing Council of the University for two years. He was re-elected as Dean of the Faculty for the second term, the position he held till he joined Elizade University Faculty of Law in late 2020.
                                </p>
                                <p>
                                    Prof Adeleke is the first substantive Dean of Law at Elizade University, Ilara Mokin, Ondo State. Continuing on the platform and foundation already laid by respected colleagues and scholars, Dr. Omolade Olomola and Dr. Bernard Jemilohun, respectively, Prof Adeleke has brought his experience to bear concerning positionin");
            WriteLiteral(@"g the faculty to meet the standard expected of an ideal Law Faculty. Prof. Adeleke combines Legal academic with professional practice as well as religious activities. He runs a law firm in Lagos and serves as a consultant to few organisations. He has authored books and monographs and has also published articles in many reputable journals nationally and internationally.
                                    He is a seasoned researcher who has benefitted from a few local grants, including Tetfund. Prof Adeleke has served in many notable associations in the country, including being a member of the National Executive Committee of the Nigerian Bar Association. He was the former President of the Muslim Lawyers Association of Nigeria and a trustee member of many social and religious organisations. He also belongs to other professional associations like the Association of Democratic Lawyers, Nigerian Bar Association and National Association of Law Teachers.
                                </p>
                      ");
            WriteLiteral(@"          <p>
                                    This university's visitor and founder thought out an enduring and everlasting legacy to today's young ones who shall eventually be tomorrow's leaders by establishing this beautifully landscaped University with a well-developed foundation for academic excellence. Law programme features prominently among other faculties and colleges.
                                    The Faculty of Law, Elizade University, Ilara-Mokin, Ondo State places a high value on teaching and research, and these two are given prime priorities as reflected in the curriculum and entire package of the LL.B programme being offered by the faculty. We note that there is a paradigm shift in the practice of law to meet with the pace at which the global world is adapting to evolving changes in the socio-economic and political landscape, we are therefore committed to providing modern and contemporary legal education and research needed to succeed in the ever-developing world. We are poised to pr");
            WriteLiteral(@"oduce knowledgeable intellectuals and skilled professionals equipped to contribute to the national economic and social development in all ramifications where law knowledge will be required.
                                    Against the background that the knowledge of the law is relevant and needed in every segment of society, the faculty is set to establish a workable and beneficent relationship with the outside world both in academic and relevant industries. The faculty is also blessed with academic staff members and non-academic support staff who provide qualitative scholarship and moral rectitude to ensure that the students realise their lofty goals, dreams, and aspirations of becoming law experts in the diverse and multifaceted areas of law. The faculty's human efforts are uniquely complemented with the cultural hub, serenity and natural ambience, all of which guarantee a conducive environment for students to learn.
                                    Over 70 percent of the staff members are PhD hold");
            WriteLiteral(@"ers in diverse areas of law and are graduates from reputable universities, both onshore and offshore. A modern separate law library infused with modern technological aid in teaching and research is being built in the faculty to serve law students exclusively. Our e-library is constantly alive with the internet to serve the students and staff researchers. The new library aims to drive the frontier of research and knowledge-based study to ensure academic growth and professional competence.
                                    In order to create an atmosphere of the diversity of perspectives to strengthen the intellectual enquiries of our students, we have carefully designed a town and wig programme where people who are experts in the legal profession both in academia and in litigation/industry are periodically invited to give stimulating talks and professional legal discourse on diverse areas of law. Why not join us to reach these desirable academic goal and professional accomplishments.
                      ");
            WriteLiteral(@"              EU Law Faculty promises the best legal education.
                                </p>
                                <hr />
                                <span style=""font-weight:600;"">
                                    <strong>
                                        Prof. Funminiyi A. R. Adeleke
                                        Dean of the Faculty of Law
                                    </strong>
                                </span>

                            </div>
